INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (217,'061','봄비가 촉촉하게 내리는 날 한가지 매화가 꽃망울을 터뜨리는 격입니다. 사람이 있어 많이 도와주니 매화가지에 봄비를 선물과 같으니 어찌 소망을 성취하지 못하겠습니까? 운수가 대길하니 도처에 봄바람이 화화하게 일겠으나 많은 재물을 얻으면 얻는 대로 액이게는 게 아니라 더러는 잃게 되는 것이니 주의하십시오. 초월은 길하고 뒤에는 흉하게 되니 매사를 조심해야 합니다. 이익이 타향에 있으니 출행하면 이익을 얻게 되겠습니다. 안보다는 밖으로 작은 것을 꿋꿋해 봄일입니다. 강남에서 풍년이 흡족하듯 매사가 성취되니 봄바람을 타 풍작과 같습니다. 봄날의 복사꽃과 가을날의 국화가 만났으니 근심과 기쁨이 상반되기도 하겠습니다. 마을 어귀에 축은한 달이 흐로 비치니 천지를 지켜잠과 같습니다.','이익을 보려나 마음대로 얻어지지 않습니다. 비록 재물은 있으나 손에 들어온 듯이 앗게 되어 버리니 얼일 날이 없겠습니다. 일을 꿋꿋하는 것이 많지만 실패하지는 못합니다. 순조롭기를 바라지 말고 노력해야 합니다.','문을 나서 남쪽으로 가면 먼저는 곤하더라도 뒤에는 성사됩니다. 하는 일에 바침을 가해 추진함이 좋습니다. 머리는 강에서 고기를 구하는 격이니 재물을 구하면 넉넉히 얻을 수 있겠습니다. 시작과 끝마침을 잘하십시오.','터를 옮기는 것도 무방하니 지체하지 마십시오. 만약 그럴 수가 없다면 환경을 바꿔봐도 좋겠습니다. 남방이 가장 길한 방향입니다. 새 일을 바이지 말고 하던 일을 꾸준히 추진해야 합니다. 3월과 4월에는 재물을 꿋꿋하지 마십시오.','일을 여러 곳에서 구하지만 마음대로 성사되어 일을 얻기는 어렵겠습니다. 만약 이사를 하거나 환경을 바꾸지 않는다면 문서로 서로 다투는 일이 생길 것입니다. 시비를 가까이 하게 되면 그 해가 적지 않을 것이니 우선 피하는 것이 상책입니다.','사람을 잘못 사귀면 해가 미칠 것인즉 사람 보는 눈을 잘 다스려야 합니다. 송사를 가까이 하지 마십시오. 마침내 크게 패하기 쉽습니다. 이 달의 운수는 흉함은 많고 길함은 적으니 기대만 가지고 성사를 바인다면 감당하기 힘들 것입니다.','출행하여 멀리 가면 이익이 물가에서 생깁니다. 물과 관계되는 것은 눈 여겨 볼일입니다. 세사를 바이면 길함이 있으니 이때를 놓치지 말아야 합니다. 하고자 하는 소망이 여의하여 희희 낙락하게 될 것이니 주저하지 말고 일을 착수해 보십시오.','필시 나누와 관계되는 사람이 도움 줄 것이니 독자를 하게 되면 길하겠습니다. 멀리 여행함을 조심하십시오. 오히려 집에 있음만 못합니다. 너무 원대한 기대를 가짐은 위험신호입니다. 이 달의 운수는 질병이 있을까 두려우니 건강을 조심하십시오','달 밖은 날 밝 창가에 귀인이 와서 도와준 격이니 구하려 하지 않고 앉았지 않았는데도 스스로 큰 재물을 얻게 되겠습니다. 나를 도와줄 사람이 누구인가 하면 사람을 신의로써 사귐에서 비롭됨이니 성실하게 대인관계를 한 탓입니다.','분수를 지키는 것이 가장 좋은 방법입니다. 인정에 약하여 마음을 곱바로 쓰지 못하면 일이 꼬여 불리해지겠습니다. 만약 과력이 아니면 심구를 더 닦을 기회가 있으니 미리 대비하여 기회를 맞이하게 되길 바랍니다.','경영하는 일은 반드시 협력함을 알게 될 것이니 자상하게 검토해야 합니다. 일이 복잡하게 꼬일 수가 있으니 구설수를 조심하여 미리 준비해야 합니다. 신수 또한 고르지 못하니 신운을 어찌하겠습니까. 지혜롭게 대처함이 중요합니다.','모든 일이 많은 것을 잃고 물흙이 많으나 집에 있으면 길합니다. 새 일을 도모하지 말고 가부를 지켜이 좋겠습니다. 이것은 서방이 길하니 일을 잘 마무리하십시오. 이 달의 운수는 길흉이 반반이니 분수를 지키십시오.','일신이 자작로 편안해 지니 모든 일이 형통해지겠습니까. 운수가 대길해 지는데 어찌 손으로 천금을 희락하지 않겠습니까. 만약 그렇지 않더라고 자신을 낮거나 가족을 덜려 기쁨을 얻게 될 것이니 이보다 더 소중한 소식이 어디 있겠습니까?','2025-03-02 12:01:09.94595+00','k');
